<title>报告系统</title>
<style>
  :root {
    --qr-top: 60%;
    --qr-width: 34%;
    --qr-maxpx: 360px;
  }
  @media (max-width: 480px) {
    :root {
      --qr-top: 62%;
      --qr-width: 36%;
      --qr-maxpx: 340px;
    }
  }
  * { box-sizing: border-box; }
  body,html{margin:0;padding:12px;background:#f6f7f9;
    font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Helvetica, Arial, 'Segoe UI Emoji', 'Apple Color Emoji', 'Noto Color Emoji', sans-serif;}
  .page{max-width:860px;margin:0 auto;}
  .tip{color:#666;font-size:14px;margin:6px 0 12px;text-align:center;}
  .card{position:relative;background:#fff;border-radius:16px;box-shadow:0 8px 28px rgba(0,0,0,.12);overflow:hidden;}
  .report-img{display:block;width:100%;height:auto;vertical-align:middle;}
  .qr-wrap{position:absolute;left:50%;top:var(--qr-top);transform:translate(-50%,-50%);
    width:min(var(--qr-width), var(--qr-maxpx));}
  .qr-wrap img{display:block;width:100%;height:auto;background:#fff;padding:10px;border-radius:12px;
    box-shadow:0 6px 22px rgba(0,0,0,.18);}
  .footer{text-align:center;color:#8a8f98;font-size:13px;margin-top:14px;}
</style>
